const Dashboard = () => {
  return (
    <div className="min-h-screen bg-gray-50 py-20">
      <div className="max-w-7xl mx-auto px-6">
        <h1 className="text-5xl font-bold text-center mb-8">Welcome back!</h1>
        <p className="text-2xl text-center text-gray-700">This is your protected dashboard. No more double login!</p>
        <button
          onClick={() => {
            localStorage.removeItem('authToken');
            window.location.href = '/';
          }}
          className="mt-8 block mx-auto px-8 py-4 bg-red-600 text-white rounded-full font-bold"
        >
          Logout
        </button>
      </div>
    </div>
  );
};

export default Dashboard;
